                        t.x = x;
                        if (trace.y) t.y = y;
                        filtered.push(t);
                    } else {
                        filtered.push(trace);
                    }
                });
                plotData[currentLocation].data = filtered;
                showPlot(currentLocation);
            }

            // Initialize with PSDP plot
            showPlot('psdp');
            </script>
